        fetch(`https://rickandmortyapi.com/api/character/${id}`)
            .then(response=>response.json())
            .then(data=>console.log(data))
    }, [])
    console.log(character)
    return(
        <div>
            <h1>Hola {id}</h1>
        </div>
    )
}
